import React, { useState, useEffect } from "react";
import axios from "axios";
import "../../styles/manager.css";

function UserManager() {
  const [username, setUsername] = useState([]);
  const [roles, setRoles] = useState([]);

  useEffect(() => {
    axios.get("http://192.168.1.94:8080/api/get/users").then((res) => {
      console.log("res", res);
      console.log("res.data", res.data);
      const tabUsers = res.data.map((item) => item);
      setUsername(tabUsers);
      console.log("tabUSERS", tabUsers);
    });
  }, []);

  return (
    <div>
      <table class="table">
        <thead>
          <tr>
            <th scope="col">UserAccount</th>
            <th scope="col">First</th>
            <th scope="col">Last</th>
            <th scope="col">Handle</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            {username.map((item, i) => (
              <div key={i}>
                <th scope="row">{item.username}</th>
              </div>
            ))}
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </table>

      {username.map((item, i) => (
        <div className="manager">
          <div className="manager-user" key={i}>
            {item.username}
          </div>
          <div className="manager-roles">
            {item.roles.map((roles) => (
              <div>{roles.name}</div>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
}

export default UserManager;
